import JsonFetch from "../utils/json-fetch";

 let Data = {
    // 请求数据
    getSearchData: async function(){
        const getSearchData = await JsonFetch.get("http://localhost//search/str");
        console.log('2');
    return getSearchData;
    },
}

export default Data;
